export default function DesignInfo(){
    let param = useParams();
    let design=getDesigne(param.designInfo);
    console.log(design)

    return(
        <div>
            <UserNav/>

        <div className="designInfo">
            <img className="designeImage"src={design.path}></img>
            <h3>{design.name}</h3>
            <p>{design.info}</p>

        </div>
        </div>
    )


}
